import React from "react";
import {Container} from './styles';

export default function Textos(){
    return(
        <div>
        <h1>Conheça o Projeto</h1>
        <p>Aqui no Projeto Visão Social acreditamos na educação como ferramenta de transformação, diariamente atendemos 130 crianças de Sobradinho 2 -DF com atividades que reforçam o aprendizado e orientam para o mercado de trabalho.</p>
     </div>
    )
};
